import React from 'react';

const TodoLists = (props) => {

    return (
    <div className = "todo__style">
        <i className = "fa fa-times" aria-hidden = "true" 
            onClick = {props.onSelect(() => {
                return props.onSelect(props.id)
            })}
        />
        <li>{props.text}</li>
    </div>
    )
};

export default TodoLists;
